import React, { Component } from 'react';
import LoginForm from '../components/LoginForm';

class Login extends Component{
    constructor(props) {
        super(props);

        this.state = {
            isLoading: true,
            signInError: '',

        };
    }


    render(){

        const {
            isLoading,
        } = this.state;

        if (isLoading) {
            return (<div><p>Loading...</p></div>)
        }

        return (
            <div>
                <LoginForm/>
            </div>
        )
    }
}

export default Login;
